  return (
    <Layout>
      <Content>
        <div>
          <Card title="Thông Tin Hóa Đơn">
            <Card.Grid style={gridStyle}>Content</Card.Grid>
            <Card.Grid hoverable={false} style={gridStyle}>
              Content
            </Card.Grid>
            <Card.Grid style={gridStyle}>Content</Card.Grid>
            <Card.Grid style={gridStyle}>Content</Card.Grid>
            
          </Card>
          ,
        </div>

        <div></div>

        <div></div>

        <div></div>
      </Content>
    </Layout>
  );
}
export default ThongTinHD;
